import React, { useEffect, useState } from "react";
import { Box, Button, FormControl, Grid, Input, InputLabel, Paper, TextField, Typography } from "@mui/material";
import Base from "../components/Base";
import TableComponentCart from "../components/TableCart";

function Cart() {
  const [value, setValue] = useState(0)
  useEffect(() => {
    setRow(JSON.parse((localStorage.getItem('products'))))
    let data = localStorage.getItem('products');
    if (data != null) {
      let cart = JSON.parse(data);
      for (let index = 0; index < cart.length; index++) {
        if (cart[index].qtd) {
          setValue(cart[index]);
        }
      }
    }
  })
  return (
    <Base title="Carrinho de Compras">
      <Paper sx={{ flexGrow: 1 }}>
        <Grid container spacing={2} mt={2}>
          <Grid item lg={12}>
            <TableComponentCart />

          </Grid>
        </Grid>
        <Grid container
          direction="row"
          justifyContent="space-between"
          alignItems="center"
        >
          <Grid item m={2}>
            <Typography>Valor da compra</Typography>
            <TextField disabled value={value} />
          </Grid>
          <Grid item m={1}>
            <Button variant="contained">Finalizar compra</Button>
          </Grid>
        </Grid>
      </Paper>
    </Base >
  );
}

export default Cart;
